, upgrades and technical assistance. GCCS-A is a member of the Family of Systems associated with Global Command and Control System - Joint (GCCS-J). GCCS-J provides critical Joint Warfighting eCommand and eControl (C2) capabilities by presenting an integrated, near real-time picture of the battle space for planning and execution of joint military and multinational operations. GCCS-J is used by all nine Combatant Commands (COCOMs) at sites around the world. GCCS-A supports the planning and execution of Army operations at strategic/operational/tactical levels of battle command. The GCCS-A software integrates GCCS-Joint software applications and infrastructure components in additions to Army-developed applications to perform Army specific functions. GCCS-J applications are developed in WebLogic, which is a Commercial Off-The-Shelf (COTS) application server for building and deploying enterprise Java Enterprise Edition applications. WebLogic provides infrastructure for transaction management supports and extends Java 2 Enterprise Edition (J2EE) security while providing a rich set of security providers that can be customized to deal with different security databases or security policies.','https://beta.sam.gov/opp/b7949ffc6803947c479b','ORACLE REAL APPLICATION CLUSTERS (RAC)LICENSE','99--Limited Source Justification under FAR 8.',462151000),('W91QUZ06D0002','W15QKN','9700','2100',2015,'W91K8Y','9700','2100','601839660','334111','7035','~ORG-1144~ORG-2398~ORG-2877~ORG-4323~ORG-4346~~~','This J&A is for a CHESS ADMC-2 requirement. Delivery Order award will be made 14 days after J&A posting date.','https://beta.sam.gov/opp/87e5f06d87cab50b34f3','THIS MODIFICATION IS TO FIX A TYPOGRAPHICAL E','70--J&A for Other than Full and Open Competit',1484170000),('W91QUZ06D0003','W52P1J','9700','2100',2015,'W52P1J','9700','2100','808068253','334111','7030','~ORG-1144~ORG-2398~ORG-2877~ORG-4323~ORG-4348~~~',NULL,NULL,'GOV NERO 2015 STD BURN ROM',NULL,852301000),('W91QUZ06D0004','W15P7T',